`,v(r.li,{children:"Add craisins, or other fruit of choice. Craisins and other dried fruit tends to stick together. I like adding them in at this stage because it can be easier to break them apart a bit and avoid overmixing or crushing delicate fruits (like blueberries) if folding in later."}),`
`,v(r.li,{children:"Mix the vanilla extract in with \xBE cup of the vegan milk of choice and add to bowl. Mix ingredients until everything is just combined, adding additional milk slowly as needed."}),`
