`,v(r.p,{children:"This recipe can easily be frozen before cooking- Just place them out on a silicone mat and put in the freezer for 30 minutes, until solid. After that, they can be moved to a ziploc bag or tupperware container without sticking together, and taken out as needed. Just bake an additional 1-2 minutes."}),`
`,v(r.p,{children:"This recipe calls for \xBC cup of pea protein powder, which can easily be substituted back for regular flour. I use it to bump up the protein content (\xBC c has 21 grams of protein), and the best part is you can\u2019t taste a difference. When I make them for my husband and myself, I use \u2153 cup instead, and still can\u2019t taste a difference, but if you\u2019re worried about it changing the flavor at all I\u2019d start with just \xBC."}),`
